import React, {Component} from 'react';

class Card extends Component {
	render() {
		return (
			<div className="bg-light-green dib br3 pa3 ma2 grow bw2 shadow-5">
				<img src="https://robohash.org/asdas?size=200x200" alt="robot"/>
				<div>
					<h2>Jane Doe</h2>
					<p>janedoe@gmail.com</p>
				</div>
			</div>
		)
	}
}

export default Card;
